import "./style.css";

export const TextInput = ({
  picture = null,
  validation = "",
  disabled = false,
  readOnly = false,
  label = "",
}) => {
  return (
    <div className="text-input-container">
      <div className="text-input-wrapper">
        {picture && <span className="text-input-icon">{picture}</span>}
        <input
          className={`text-input-field ${picture ? "with-icon" : ""}`}
          placeholder={label}
          disabled={disabled}
          readOnly={readOnly}
        />
      </div>
      {validation && <p className="text-input-validation">{validation}</p>}
    </div>
  );
};
